        [Theory]
        [InlineData(1, AxialStiffnessUnit.Newton, 1, AxialStiffnessUnit.Newton, true)]  // Same value and unit.
        [InlineData(1, AxialStiffnessUnit.Newton, 2, AxialStiffnessUnit.Newton, false)] // Different value.
        [InlineData(2, AxialStiffnessUnit.Newton, 1, AxialStiffnessUnit.Decanewton, false)] // Different value and unit.
        [InlineData(1, AxialStiffnessUnit.Newton, 1, AxialStiffnessUnit.Decanewton, false)] // Different unit.
        public void Equals_ReturnsTrue_IfValueAndUnitAreEqual(double valueA, AxialStiffnessUnit unitA, double valueB, AxialStiffnessUnit unitB, bool expectEqual)
        {
            var a = new AxialStiffness(valueA, unitA);
            var b = new AxialStiffness(valueB, unitB);

            // Operator overloads.
            Assert.Equal(expectEqual, a == b);
            Assert.Equal(expectEqual, b == a);
            Assert.Equal(!expectEqual, a != b);
            Assert.Equal(!expectEqual, b != a);

            // IEquatable<T>
            Assert.Equal(expectEqual, a.Equals(b));
            Assert.Equal(expectEqual, b.Equals(a));

            // IEquatable
            Assert.Equal(expectEqual, a.Equals((object)b));
            Assert.Equal(expectEqual, b.Equals((object)a));
        }

