                Assert.Equal("0.12 N", new AxialStiffness(0.123456, AxialStiffnessUnit.Newton).ToString("s2"));
                Assert.Equal("0.123 N", new AxialStiffness(0.123456, AxialStiffnessUnit.Newton).ToString("s3"));
                Assert.Equal("0.1235 N", new AxialStiffness(0.123456, AxialStiffnessUnit.Newton).ToString("s4"));
            }
            finally
            {
                CultureInfo.CurrentCulture = oldCulture;
            }
        }

        [Fact]
        public void ToString_SFormatAndCulture_FormatsNumberWithGivenDigitsAfterRadixForGivenCulture()
        {
            var culture = CultureInfo.InvariantCulture;
            Assert.Equal("0.1 N", new AxialStiffness(0.123456, AxialStiffnessUnit.Newton).ToString("s1", culture));
            Assert.Equal("0.12 N", new AxialStiffness(0.123456, AxialStiffnessUnit.Newton).ToString("s2", culture));
            Assert.Equal("0.123 N", new AxialStiffness(0.123456, AxialStiffnessUnit.Newton).ToString("s3", culture));
            Assert.Equal("0.1235 N", new AxialStiffness(0.123456, AxialStiffnessUnit.Newton).ToString("s4", culture));
        }

